import React from 'react';
import './Footer.css';
import { Row, Col } from 'reactstrap';

export default class Footer extends React.Component {

render(){
  return (
      <div className="Footer">
      <Row>
        <Col sm="4">
          <a className="TitreFooter">Mickael Gremy & </a>
        </Col>
        <Col sm="4">
          <a className="TitreFooter">Jules Lestrade</a>
        </Col>
        <Col sm="4">
          <a className="TitreFooter">Copyright &copy; 2020</a>
        </Col>
      </Row>
      </div>
    );
  }
}
